import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5005/api';

const Login = ({ onLogin }) => {
  const [clientId, setClientId] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate inputs
    if (!clientId) {
      toast.error('Please enter your Client ID');
      return;
    }

    if (!password) {
      toast.error('Please enter your password');
      return;
    }

    setLoading(true);

    try {
      const response = await axios.post(
        `${API_URL}/login`,
        { 
          client_id: clientId,
          password: password 
        },
        { withCredentials: true }
      );

      // Store client ID in local storage
      localStorage.setItem('clientId', clientId);

      // Handle different login scenarios
      if (response.data.needOTP) {
        navigate('/verify-otp');
        toast.info('Please enter the OTP sent to your registered mobile/email');
      } else {
        onLogin();
        toast.success('Authentication successful!');
        navigate('/dashboard');
      }
    } catch (error) {
      const message = error.response?.data?.message || 'Authentication failed. Please try again.';
      toast.error(message);
    } finally {
      setLoading(false);
    }
  };

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div className="row justify-content-center">
      <div className="col-md-6">
        <div className="card">
          <div className="card-header">
            <h4 className="text-center">Login to Your Account</h4>
          </div>
          <div className="card-body">
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="clientId" className="form-label">
                  Client ID
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="clientId"
                  value={clientId}
                  onChange={(e) => setClientId(e.target.value)}
                  required
                  placeholder="Enter your Client ID"
                />
              </div>

              <div className="mb-3">
                <label htmlFor="password" className="form-label">
                  Password
                </label>
                <div className="input-group">
                  <input
                    type={showPassword ? "text" : "password"}
                    className="form-control"
                    id="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                    placeholder="Enter your password"
                  />
                  <button 
                    className="btn btn-outline-secondary" 
                    type="button" 
                    onClick={togglePasswordVisibility}
                  >
                    {showPassword ? "Hide" : "Show"}
                  </button>
                </div>
                <small className="form-text text-muted">
                  Enter your password to generate an OTP
                </small>
              </div>

              <div className="d-grid gap-2">
                <button
                  type="submit"
                  className="btn btn-primary"
                  disabled={loading}
                >
                  {loading ? (
                    <span>
                      <span className="spinner-border spinner-border-sm me-2" />
                      Authenticating...
                    </span>
                  ) : (
                    'Authenticate'
                  )}
                </button>
              </div>
            </form>

            <div className="mt-3 text-center">
              <p>
                Don't Have Your Account Information Saved With Us?{' '}
                <a href="/register">Save it Here First</a>
              </p>
              <p>
                <a href="/forgot-password">Forgot Password?</a>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
